import styled from "styled-components";

export const FormAuth = styled.form`
    display:flex;
    align-items:center;
    justify-content:center;
    flex-direction:column;
    width: 20vw;
    height:30vh;
    background-color:blue;

    label {
        color:white;
        text-align:center;
    }
    input {
        width: 12vw;
        height:3vh;
        margin:10px;
        border-radius:10px;
        background-color:pink;
    }
    button{
        width: 7vw;
        height:3vh;
